impl<'a> From<WrapperRcOwn> for RectF<'a> {
    fn from(t: WrapperRcOwn) -> Self {
        let mut data = RURectF {
            qt_data: ::std::ptr::null(),
            host_data: ::std::ptr::null(),
            all_funcs: t.all_funcs as *const RURectFAllFuncs,
        };

        if t.owned {
            data.host_data = t.data as *const RUBase;
            RectF::new_from_rc(data)
        } else {
            data.qt_data = t.data as *const RUBase;
            RectF::new_from_temporary(data)
        }
    }
}

pub trait RectFTrait<'a> {
    #[inline]
    #[doc(hidden)]
    fn get_rect_f_obj_funcs(&self) -> (*const RUBase, *const RURectFFuncs);
}

impl<'a> RectFTrait<'a> for RectF<'a> {
    #[doc(hidden)]
    fn get_rect_f_obj_funcs(&self) -> (*const RUBase, *const RURectFFuncs) {
        let obj = self.data.get().unwrap();
        unsafe { (obj, (*self.all_funcs).rect_f_funcs) }
    }
}
